import React from 'react';
import GIF from './GIF';
import Roadmap from './Roadmap';
import Feedback from './Feedback';
import Elements from './Elements';
import './Homepage.css';

const Homepage = () => {
  return (
    <div className="homepage">
      <GIF />
      <Elements />
      <Roadmap />
      <Feedback />
    </div>
  );
};

export default Homepage;
